@Article{md12115372, AUTHOR = {Puddick, Jonathan and Prinsep, Michèle R. and Wood, Susanna A. and Kaufononga, Sangata A. F. and Cary, Stephen Craig and Hamilton, David P.}, TITLE = {High Levels of Structural Diversity Observed in Microcystins from Microcystis CAWBG11 and Characterization of Six New Microcystin Congeners}, JOURNAL = {Marine Drugs}, VOLUME = {12}, YEAR = {2014}, NUMBER = {11}, PAGES = {5372--5395}, URL = {https://www.mdpi.com/1660-3397/12/11/5372}, PubMedID = {25402827}, ISSN = {1660-3397}, ABSTRACT = {Microcystins (MCs) are cyclic peptides produced by cyanobacteria, which can be harmful to humans and animals when ingested. Differences in the coding of the non‑ribosomal peptide synthetase/polyketide synthase enzyme complex responsible for microcystin production have resulted in more than 100 microcystin variants being reported to date. The microcystin diversity of Microcystis CAWBG11 was investigated using matrix-assisted laser desorption/ionization-time of flight mass spectrometry and liquid chromatography-mass spectrometry. This revealed that CAWBG11 simultaneously produced 21 known microcystins and six new congeners: [Asp3] MC-RA, [Asp3] MC-RAba, [Asp3] MC-FA, [Asp3] MC-WA, MC-FAba and MC-FL. The new congeners were putatively characterized by tandem mass spectrometry and chemical derivatization. A survey of the microcystin congeners produced by 49 cyanobacterial strains documented in scientific literature showed that cyanobacteria generally produce four microcystin congeners, but strains which produce up to 47 microcystin congeners have been reported. Microcystis CAWBG11 (which produces at least 27 congeners) was positioned in the top ten percentile of the strains surveyed, and showed fluidity of the amino acids incorporated into both position two and position four.}, DOI = {10.3390/md12115372} }

